class Solution:
    def evalRPN( tokens: list[str]) -> int:
        stack = []
        for i in tokens:
            if i not in "+-*/":
                stack.append(i)
            elif i== "+":
                stack.append(str(eval(f"{stack.pop()}+{stack.pop()}")))
            elif i== "-":
                first = stack.pop()
                second = stack.pop()
                stack.append(str(eval(f"{second}-{first}")))
            elif i== "*":
                stack.append(str(eval(f"{stack.pop()}*{stack.pop()}")))
            elif i== "/":
                first = stack.pop()
                second = stack.pop()
                stack.append(str(int(eval(f"{second}/{first}"))))
        return stack[0]
